import React from 'react';


function QuoteCard({character}) {
    return (
        <figure className="QuoteCard">
        <img src={character.image} alt={character.character}/>
        <figcaption>
        <blockquote>

            {character.quote}
        </blockquote>
        <p>
        <cite> {character.character} </cite>
        </p>
        </figcaption>
        </figure>
    )
};

export default QuoteCard;
